import React from "react";
import "./Inscribir.css";
import { Col, Row } from 'antd';
import { Form, Input, message } from 'antd';

export const Inscribir = () => {
    const [form] = Form.useForm();

    const onFinish = () => {
        message.success('Submit success!');
    };

    const onFinishFailed = () => {
        message.error('Submit failed!');
    };

    return (
        <div className="inscribir-container">
            <Form
                form={form}
                layout="vertical"
                onFinish={onFinish}
                onFinishFailed={onFinishFailed}
                autoComplete="off"
            >
                <Form.Item
                    name="nombre"
                    label="Nombre"
                    rules={[
                        { required: true },
                        { type: 'url', warningOnly: true },
                        { type: 'string', min: 6 }
                    ]}
                >
                    <Input placeholder="input placeholder" />
                </Form.Item>
            </Form>

            <Row className="inscribir-row">
                <Col className="inscribir-col" span={12}>
                    <Form
                        form={form}
                        layout="vertical"
                        onFinish={onFinish}
                        onFinishFailed={onFinishFailed}
                        autoComplete="off"
                    >
                        <Form.Item
                            name="director"
                            label="Director"
                            rules={[
                                { required: true },
                                { type: 'url', warningOnly: true },
                                { type: 'string', min: 6 }
                            ]}
                        >
                            <Input />
                        </Form.Item>
                    </Form>
                </Col>

                <Col className="inscribir-col" span={12}>
                    <Form
                        form={form}
                        layout="vertical"
                        onFinish={onFinish}
                        onFinishFailed={onFinishFailed}
                        autoComplete="off"
                    >
                        <Form.Item
                            name="correo"
                            label="Correo electrÃ³nico"
                            rules={[
                                { required: true },
                                { type: 'url', warningOnly: true },
                                { type: 'string', min: 6 }
                            ]}
                        >
                            <Input />
                        </Form.Item>
                    </Form>
                </Col>
            </Row>
        </div>
    );
}

export default Inscribir;
